// Setting socket
const socket = io();
let data;
let myChart;
let context;
let showVote1 = document.getElementById('showVote1');
let showVote2 = document.getElementById('showVote2');
let showVote3 = document.getElementById('showVote3');
let showVote4 = document.getElementById('showVote4');

// Konfigurasi waktu
let time = new Date();

let tahun = time.getFullYear();
let bulan = time.getMonth();
let tgl = time.getDate();
let hari = time.getDay();
let jam = time.getHours();
let menit = time.getMinutes();
let detik = time.getSeconds();

let namaHari;
let namaBulan;

switch(hari){
  case 0 :  namaHari = "Minggu"; break;
  case 1 :  namaHari = "Senin"; break;
  case 2 :  namaHari = "Selasa"; break;
  case 3 :  namaHari = "Rabu"; break;
  case 4 :  namaHari = "Kamis"; break;
  case 5 :  namaHari = "Jum'at"; break;
  case 6 :  namaHari = "Sabtu"; break;
}

switch(bulan){
  case 0 :  namaBulan = "Januari"; break;
  case 1 :  namaBulan = "Februari"; break;
  case 2 :  namaBulan = "Maret"; break;
  case 3 :  namaBulan = "April"; break;
  case 4 :  namaBulan = "Mei"; break;
  case 5 :  namaBulan = "Juni"; break;
  case 6 :  namaBulan = "Juli"; break;
  case 7 :  namaBulan = "Agustus"; break;
  case 8 :  namaBulan = "September"; break;
  case 9 :  namaBulan = "Oktober"; break;
  case 10 :  namaBulan = "November"; break;
  case 11 :  namaBulan = "Desember"; break;
}

// Menampilkan waktu saat ini
let showTgl = `${namaHari},\r${tgl} ${namaBulan} ${tahun}\r${jam}:${menit}:${detik}`;
let showTgl2 = `${namaHari}, ${tgl} ${namaBulan} ${tahun}`;

let showJam = `${namaHari},\r${tgl} ${namaBulan} ${tahun} - ${jam}:${menit}:${detik}`;

// Jam Dinding
let timeDisplay = document.getElementById("time");

function refreshTime() {
  let dateString = new Date().toLocaleString();
  let formattedString = dateString.replace(", ", " - ");
  timeDisplay.innerHTML = formattedString;
}
refreshTime();
setInterval(refreshTime, 1000);

//Auto Refresh every 5 sec
setTimeout(function(){
   window.location.reload(1);
}, 5000);

// image data
let imgData = "data:image/jpeg;base64,";
let imgTable = "data:image/jpeg;base64,";

// modal
$(document).ready(function(){
  $(".modal").modal();
});

// Floating button
document.addEventListener('DOMContentLoaded', function() {
  var elems = document.querySelectorAll('.fixed-action-btn');
  var instances = M.FloatingActionButton.init(elems, options);
});

data = {
  labels: ['paslon satu', 'paslon dua', 'suara golput', 'paslon tiga'], //
  datasets: [
          {
            label: 'Voting',
            backgroundColor: ['#e67e22', '#2980b9', '#57606f' , '#2ed573'], //
            data: [],
          }
      ]
};

context = document.getElementById('vote-result').getContext('2d');
myChart = new Chart(context,{
  type: 'pie',
  data: data,
  options: {
      animation:{
        animateScale: true
      },
      tooltips: {
        callbacks: {
          label: function (tooltipItem, data){
            let dataset = data.datasets[tooltipItem.datasetIndex];
            let total = dataset.data.reduce(function(previousValue, currentValue, currentIndex, array) {
              return previousValue + currentValue;
            });
            let currentValue = dataset.data[tooltipItem.index];
            let precentage = Math.floor(((currentValue/total) * 100)+0.5);
            return precentage + "%";
          }
        }
      }
  }
});


// Menerima & menampilkan socket.io dari server
socket.on('vote', function (response) {
  let i = 0;

  for (let key in response) {

      data.labels[i] = response[i]._id;
      data.datasets[0].data[i] = response[i].total;

      i++;
  }

  // Menampilkan Total suara setiap pasangan calon
  let show1 = showVote1.innerHTML = response.find(vote => vote._id === "paslon-satu").total;
  let show2 = showVote4.innerHTML = response.find(vote => vote._id === "paslon-empat").total;
  let show3 = showVote3.innerHTML = response.find(vote => vote._id === "paslon-tiga").total;
  let show4 = showVote2.innerHTML = response.find(vote => vote._id === "paslon-dua").total;

  // Ubah Array Object menjadi String
  let numStr1 = show1.toString();
  let numStr2 = show2.toString();
  let numStr3 = show3.toString();
  let numStr4 = show4.toString();

  // Update chart
  myChart.update();


  // Total Voters
  let jmlVote1 = parseInt(numStr1);
  let jmlVote2 = parseInt(numStr2);
  let jmlVote3 = parseInt(numStr3);
  let jmlVote4 = parseInt(numStr4);

  let jmlVote = jmlVote1 + jmlVote2 + jmlVote3 + jmlVote4;

  // total vote
  let totVote = 100;

  let tot_jml = totVote - jmlVote;
  document.getElementById("vote_tot").innerHTML = tot_jml;

  document.getElementById("total_voting").innerHTML = `Jumlah Voting : ${jmlVote}`;


  // Generate download PDF
  document.getElementById('generateDownloadPDF').addEventListener('click', function(){
    var doc = new jsPDF();

    // Tampilkan Header
    doc.addImage(imgData, 'JPEG', 15, 10, 180, 30);
    doc.setFontSize(16);
    doc.text(45, 50, 'Hasil Perhitungan Rekapitulasi Suara E-Voting');
    doc.addImage(imgTable, 'JPEG', 20, 70, 170, 140);

    // Tampilkan nomor Counter
    doc.setFontSize(40);
    doc.text(123, 101, numStr1);
    doc.text(123, 132, numStr4);
    doc.text(123, 164, numStr3);
    doc.text(123, 197, numStr2);

    // Tampilkan waktu / Tanggal
    doc.setFontSize(12);
    doc.text(160, 92, showTgl);
    doc.text(160, 123, showTgl);
    doc.text(160, 155, showTgl);
    doc.text(160, 188, showTgl);

    // Tampilkan tanda tangan
    doc.setFontSize(11);
    doc.text(130, 225, `Tangerang, ${showTgl2}`);
    doc.text(156, 230, "Ketua Panitia TPS");
    doc.text(170, 275, "Fulan, SH");

    doc.save("Laporan-Hasil-Voting.pdf");
  });

  // Generate print out PDF
  document.getElementById('generatePrintPDF').addEventListener('click', function(){
    var doc = new jsPDF();

    //Show Image Header & Table
    doc.addImage(imgData, 'JPEG', 15, 10, 180, 30);
    doc.setFontSize(16);
    doc.text(45, 50, 'Hasil Perhitungan Rekapitulasi Suara E-Voting');
    doc.addImage(imgTable, 'JPEG', 20, 70, 170, 140);

    // Tampilkan nomor Counter
    doc.setFontSize(40);
    doc.text(123, 101, numStr1);
    doc.text(123, 132, numStr4);
    doc.text(123, 164, numStr3);
    doc.text(123, 197, numStr2);

    // Tampilkan waktu / Tanggal
    doc.setFontSize(12);
    doc.text(160, 92, showTgl);
    doc.text(160, 123, showTgl);
    doc.text(160, 155, showTgl);
    doc.text(160, 188, showTgl);

    // Tampilkan tanda tangan
    doc.setFontSize(11);
    doc.text(130, 225, `Tangerang, ${showTgl2}`);
    doc.text(156, 230, "Ketua Panitia TPS");
    doc.text(170, 275, "Fulan, SH");

    doc.autoPrint();
    window.open(doc.output('bloburl'), '_blank');
  });

});